import Card from '../UI/Card';
import ExpenseItem from './ExpenseItem';
import ExpensesFilter from './ExpensesFilter';
import './Expenses.css';
import { useState } from 'react';

const Expenses = ({ expenses }) => {

  // const [year, setYear] = useState('');

  const handleSelectedYear = (selectedYear) => {
    console.log('Selected year from Expenses', selectedYear);
  }

  return (
      <Card className="expenses">
        <ExpensesFilter onSelectedYear={handleSelectedYear} />
        {/* <p>{year}</p> */}
        <ExpenseItem
          title={expenses[0].title}
          amount={expenses[0].amount}
          timepoint={expenses[0].timepoint}
        />
        <ExpenseItem
          title={expenses[1].title}
          amount={expenses[1].amount}
          timepoint={expenses[1].timepoint}
        />
        <ExpenseItem
          title={expenses[2].title}
          amount={expenses[2].amount}
          timepoint={expenses[2].timepoint}
        />
        <ExpenseItem
          title={expenses[3].title}
          amount={expenses[3].amount}
          timepoint={expenses[3].timepoint}
        />
      </Card>
  );
}

export default Expenses;
